import React from "react";
import Ndata from "./Ndata";
import Naat from "./Naat";

const NotFavourite = () => {
  return (
    <Naat
      key={val.id}
      pic={val.pic}
      cat={val.cat}
      tit={val.tit}
      link={val.link}
      dlink={val.dlink}
    />
  );
};

export default NotFavourite;
